" 49 :   public void visit(NodeTraversal t, Node n, Node parent) {
 50 :     // VOID nodes appear when there are extra semicolons at the BLOCK level.
 51 :     // I've been unable to think of any cases where this indicates a bug,
 52 :     // and apparently some people like keeping these semicolons around,
 53 :     // so we'll allow it.
 54 :     if (n.getType() == Token.EMPTY ||
 55 :         n.getType() == Token.COMMA) {
 56 :       return;
 57 :     }
 58 : 
 59 :     if (parent == null)
 60 :       return;
 61 : 
 62 :     int pt = parent.getType();
 63 :     if (pt == Token.COMMA) {
 64 :       if (n == parent.getLastChild()) {
 65 :         for (Node an : parent.getAncestors()) {
 66 :           int ancestorType = an.getType();
 67 :           if (ancestorType == Token.COMMA)
 68 :             continue;
 69 :           if (ancestorType != Token.EXPR_RESULT &&
 70 :               ancestorType != Token.BLOCK)
 71 :             return;
 72 :           else
 73 :             break;
 74 :         }
 75 :       }
 76 :     } else if (pt != Token.EXPR_RESULT && pt != Token.BLOCK) {
 77 :       if (pt == Token.FOR && parent.getChildCount() == 4 &&
 78 :           (n == parent.getFirstChild() ||
 79 :            n == parent.getFirstChild().getNext().getNext())) {
 80 :         // Fall through and look for warnings for the 1st and 3rd child
 81 :         // of a for.
 82 :       } else {
 83 :         return;  // it might be ok to not have a side-effect
 84 :       }
 85 :     }
 86 :     if (NodeUtil.isSimpleOperatorType(n.getType()) ||
 87 :         !NodeUtil.mayHaveSideEffects(n)) {
 88 :       if (n.isQualifiedName() && n.getJSDocInfo() != null) {
 89 :         // This no-op statement was there so that JSDoc information could
 90 :         // be attached to the name. This check should not complain about it.
 91 :         return;
 92 :       } else if (NodeUtil.isExpressionNode(n)) {
 93 :         // we already reported the problem when we visited the child.
 94 :         return;
 95 :       }
 96 : 
 97 :       String msg = "This code lacks side-effects. Is there a bug?";
 98 :       if (n.getType() == Token.STRING) {
 99 :         msg = "Is there a missing '+' on the previous line?";
100 :       }
101 : 
102 :       t.getCompiler().report(
103 :           JSError.make(t, n, level, USELESS_CODE_ERROR, msg));
104 :     }
105 :   }"

